import React from 'react';

function Header({ handlePage, page }) {
    return (
      <div className='bg-red text-white text-xl flex items-center justify-between px-4 py-2'>
        <h1 className='text-gold font-bold text-3xl'>CHANSE SHIRLEY</h1>
        <p
          className={`cursor-pointer ${
            page === 'about' ? 'text-gold' : 'text-white hover:text-gold transition'
          }`}
          onClick={() => handlePage('about')}
        >
          About Me
        </p>
        <p
          className={`cursor-pointer ${
            page === 'portfolio' ? 'text-gold' : 'text-white hover:text-gold transition'
          }`}
          onClick={() => handlePage('portfolio')}
        >
          Portfolio
        </p>
        <p
          className={`cursor-pointer ${
            page === 'resume' ? 'text-gold' : 'text-white hover:text-gold transition'
          }`}
          onClick={() => handlePage('resume')}
        >
          Resume
        </p>
        <p
          className={`cursor-pointer ${
            page === 'contact' ? 'text-gold' : 'text-white hover:text-gold transition'
          }`}
          onClick={() => handlePage('contact')}
        >
          Contact
        </p>
      </div>
    );
  }
  
  export default Header;
